import React from 'react';
import Navbar from './Navbar.jsx';
import { ContactPageComplete } from './components/contact.tsx';
import Footer from './components/Footer.jsx';
import { Toaster } from './components/ui/toaster';

const colors = {
  darkBlue: '#022b3a',
  blue: '#1f7a8c',
  lightBlue: '#bfdbf7',
  paleBlue: '#e1e5f2',
  white: '#ffffff',
};

function App() {
  return (
    <div className="flex flex-col min-h-screen" style={{ background: '#000000', fontFamily: 'Helvetica Neue, sans-serif' }}>
      <Navbar />
      <main style={{ minHeight: '60vh' }}>
        <ContactPageComplete />
      </main>
      <Footer />
      <Toaster />
    </div>
  );
}

export default App;
